<h3>New Signup</h3>
<p>Registrations are not allowed.</p>
<p>You are already logged in.</p>
<p class="form-info-">All fields are required.</p>
<p class="form-info-red">Username already exists. Please choose another one.</p>
<p class="form-info-error">Sorry, that email address is already used!</p>
<p class="form-info-red">Passwords don't match</p>
<p class="form-info-red">Your password must be at least 6 characters long and have at least one letter and one number in it.</p>
<form id="student-settings" name="student-settings" method="post" class="student-settings signup-form">
	<p>
		<label class="firstname"><br>
			<span>First Name:</span><br>
			<input type="text" name="first_name" value="" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%; cursor: auto;"><br>
		</label>
	</p>
	<p>
		<label class="lastname"><br>
			<span>Last Name:</span><br>
			<input type="text" name="last_name" value=""><br>
		</label>
	</p>
	<p>
		<label class="username"><br>
			<span>Username:</span><br>
			<input type="text" name="username" value=""><br>
		</label>
	</p>
	<p>
		<label class="email"><br>
			<span>E-mail:</span><br>
			<input type="text" name="email" value=""><br>
		</label>
	</p>
	<p>
		<label class="password"><br>
			<span>Password:</span><br>
			<input type="password" name="password" value="" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%;"><br>
		</label>
	</p>
	<p>
		<label class="password-confirm right"><br>
			<span>Confirm Password:</span><br>
			<input type="password" name="password_confirmation" value="" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%;"><br>
		</label><br>
		<label class="weak-password-confirm"><br>
			<input type="checkbox" name="confirm_weak_password" value="1"><br>
			<span>Confirm use of weark password</span><br>
		</label>
	</p>
	<p>
		<label class="existing-link full"><br>
			Already have an account? <a href="#">Login to your account</a>!<br>
		</label><br>
		<label class="submit-link full-right"><br>
			<input type="submit" name="student-settings-submit" class="apply-button-enrolled" value="Create an Account"><br>
		</label><br>
	</p>
</form>
<div class="clearfix" style="clear: both;"></div>
